import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
constructor() {
  super();

  this.state = {
    monsters: [
      {
        id: '12e1231e',
        name: 'Linda'
      },
      {
        id: '12d1231e',
        name: 'Bob'
      },
      {
        id: '1231e',
        name: 'Trampy'
      },
      {
        id: '12e12',
        name: 'Oliver'
      }
    ]

  }
}

  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {
            return <div key={monster.id}>
              <h1>{monster.name}</h1>
            </div>
          })
        }
      </div>
    );
  }
}

export default App;
